import { Component, React } from "react";
import Header from "../components/header/Header";

class Signup extends Component{
    constructor(props){
        super(props)
        this.state={
            user:{
                fullName:'',
                dob:'',
                email:'',
                phone:'',
                password:'',
                cpassword:''
            }
        }
    }
    inputDataChange=(event)=>{
        this.setState({
            user:{
                fullName:event.target.value,
                dob:event.target.value,
                email:event.target.value,
                phone:event.target.value,
                password:event.target.value,
                cpassword:event.target.value
            }
        })
    }
    render(){
        return(
            <div>
                <Header/>
                <h2>Sign up to get started. It's free and always will be.</h2>
                <div className="container">
                    <label>Full name</label>
                    <input type="text" value={this.state.user.fullName} onChange={this.inputDataChange} />
                    <label>Email</label>
                    <input type="email" value={this.state.user.email} onChange={this.inputDataChange} />
                    <label>Phone</label>
                    <input type="number" value={this.state.user.phone} onChange={this.inputDataChange} />
                    <label>Password</label>
                    <input type="password" value={this.state.user.password} onChange={this.inputDataChange} />
                    <label>Confirm password</label>
                    <input type="password" value={this.state.user.cpassword} onChange={this.inputDataChange}/>
                    <button>Sign Up</button>
                </div>
            </div>
            )
        }
}
export default Signup;
